import React, { useState } from "react";
import { useEffect } from "react";

function Films() {
  const [films, setFilms] = useState([]);
  useEffect(() => {
    fetch("/api/films")
      .then((res) => res.json())
      .then((films) => setFilms({ films }));
  }, []);
  console.log(films);
  return (
    <ul>
      {films.map((film) => (
        <li key={film.id}>{film.name}</li>
      ))}
    </ul>
  );
}

export default Films;
